{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/arojasf/case-study-bellabeat?scriptVersionId=150333765\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"324a16e6","metadata":{"_cell_guid":"26f73123-3944-4300-9d18-679dff61e740","_uuid":"f668b2b9-40a9-4524-b26f-b5c38fe975dd","papermill":{"duration":0.008594,"end_time":"2023-11-12T02:47:02.47693","exception":false,"start_time":"2023-11-12T02:47:02.468336","status":"completed"},"tags":[]},"source":["# Case Study BellaBeat Company"]},{"cell_type":"markdown","id":"dfe94bb9","metadata":{"_cell_guid":"20e8a80f-ef9f-4ce7-91cc-53ca11dcea4c","_uuid":"9e916671-2c51-4aee-853d-bd4e2ed2d23d","papermill":{"duration":0.007507,"end_time":"2023-11-12T02:47:02.493175","exception":false,"start_time":"2023-11-12T02:47:02.485668","status":"completed"},"tags":[]},"source":["**Scenario:** You are a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the\n","global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. You have been asked to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights you discover will then help guide marketing strategy for the company. You will present your analysis to the Bellabeat executive team along with your high-level recommendations for Bellabeat’s marketing strategy.\n","\n","**Business Task:**\n","1. Analyze smart device usage data in order to gain insight into how people are already using their smart device.\n","2. Provide high-level recommendations for how these trends can inform Bellabeat marketing strategy.\n","\n","**Questions:**\n","* What are some trends in smart device usage?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"e2b440a5","metadata":{"_cell_guid":"33343244-b273-43a2-a846-b034d289ee58","_uuid":"8e9651c1-d766-4cc0-8375-e2f742f80ff1","papermill":{"duration":0.00794,"end_time":"2023-11-12T02:47:02.510459","exception":false,"start_time":"2023-11-12T02:47:02.502519","status":"completed"},"tags":[]},"source":["# Data Quality\n","\n","The data given should be evaluated for quality, as this determines the accuracy of our conclusions.\n","\n","* Data Source: the data comes from a 3rd party source, making it low in reliability.\n","* Age: Dataset is 7 years old (2016), considered outdated.\n","* Sample size: The data was taken from 30 participants, too few to be a good representation of the population.\n","* Time Span: data was collected over a span of 2 months in 2016, too short of a time span to accurately make predictions of monthly and yearly time frames.\n","\n","### Other things to point out\n","* There is not enough participant information provided. For a company tailoring their product to exclusively women, we do not know even if any the dataset participants are women. This may have an effect on the effectiveness of the conclusions drawn from the data.\n","* In the Weight Table, \n","    * Weight is a bad indicator for fitness due to factors such as varying muscle mass, fat ratios, weight, age, sex, height, etc which is not included in this dataset.\n","    * BMI should not taken into account due to it being an inaccurate reporter for fitness levels.\n","    * Manual self reports for weight aren’t a 100% trusted source due to potential data bias in self input.\n","    * There is not enough data in the set to draw weight conclusions from. \n","    \n","In conclusion, Due to the low score in the credibility and limitation assessment, the dataset is a poor candidate to be drawing conclusions from. However, it contains sufficient information for the company’s inquiries, as long as we acknowledge the limitations and weaknesses of the data, and take this into account when extracting its trends and recommendations."]},{"cell_type":"markdown","id":"ff021036","metadata":{"_cell_guid":"a534831b-1986-4af2-a291-92c1b7678c02","_uuid":"41801699-d417-43a2-bce7-515777e1d3bb","papermill":{"duration":0.007611,"end_time":"2023-11-12T02:47:02.525773","exception":false,"start_time":"2023-11-12T02:47:02.518162","status":"completed"},"tags":[]},"source":["## Importing\n","\n","Loading all packages to help us with the analysis:"]},{"cell_type":"code","execution_count":1,"id":"fe48254f","metadata":{"_cell_guid":"94a21518-f879-4523-a4e0-e76cdd529c0a","_uuid":"ae10a316-2618-4b1a-8f61-32d7373188ae","collapsed":false,"execution":{"iopub.execute_input":"2023-11-12T02:47:02.544262Z","iopub.status.busy":"2023-11-12T02:47:02.542538Z","iopub.status.idle":"2023-11-12T02:47:03.456938Z","shell.execute_reply":"2023-11-12T02:47:03.455451Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.92652,"end_time":"2023-11-12T02:47:03.459837","exception":false,"start_time":"2023-11-12T02:47:02.533317","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mti