nt of steps averaged to about 4000 on Sundays, while in May, the least amount was around 2000 on Saturdays.\n","\n","Unfortunately, we would need more data collected over a larger period to understand monthly trends in steps and how they are influenced. For example, weather changes may have an influence in the amount of steps taken. For now without sufficient data, it is an interesting point to possible explore further in the future, and may uncover trends that may benefit the consumer.\n","\n","Encouraging the consumer to take more steps will always be beneficial to their health, and should be a potential point of emphasis."]},{"cell_type":"markdown","id":"c6668fb3","metadata":{"_cell_guid":"d1f96cb4-73ad-4dcd-911e-5f1e9cfe88ed","_uuid":"40ef509c-1398-4a12-bf9f-e7dc4c7151a0","papermill":{"duration":0.011727,"end_time":"2023-11-12T02:47:05.364562","exception":false,"start_time":"2023-11-12T02:47:05.352835","status":"completed"},"tags":[]},"source":["## Analysis of Activity Levels"]},{"cell_type":"code","execution_count":16,"id":"75b6a4a0","metadata":{"_cell_guid":"42e5f0f2-c9b1-4a76-9af7-105b9deae3a5","_uuid":"a896b7ea-e330-46e3-8746-8c71ba886a34","collapsed":false,"execution":{"iopub.execute_input":"2023-11-12T02:47:05.390345Z","iopub.status.busy":"2023-11-12T02:47:05.389024Z","iopub.status.idle":"2023-11-12T02:47:05.859946Z","shell.execute_reply":"2023-11-12T02:47:05.858462Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.485805,"end_time":"2023-11-12T02:47:05.861739","exception":false,"start_time":"2023-11-12T02:47:05.375934","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2BN5x/H8e+5K3snkghiz9hqz1I/arRaWt0UNapGxCpKUatFVVEtqkONGqWt\nqq1WW6pVYm9iJSKRPc/vj0tEEskNWT33/frrnuc85znf5+SGT86551xFVVUBAADAf5+usAsA\nAABA3iDYAQAAaATBDgAAQCMIdgAAABpBsAMAANAIgh0AAIBGEOwAAAA0gmAHAACgEdYV7NTU\nmIr2JkVRdHrTweikPBnzr9G1FEVpv+tqvm5iiZhr8xRFsXVpmrfDPpp/pz+hKErr9Rce