c309c52","metadata":{"_cell_guid":"e87bee58-a28b-4b88-bd4b-5c17cd4216c9","_uuid":"02387090-6603-4b29-ab5a-2dbd8a0233bc","papermill":{"duration":0.015226,"end_time":"2023-11-12T02:47:07.706021","exception":false,"start_time":"2023-11-12T02:47:07.690795","status":"completed"},"tags":[]},"source":["**The key takeaways from the dataset:**\n","- Users are not getting enough sleep every night.\n","- There is a positive correlation between calories burned and steps taken.\n","- Activity tends to increase during the weekends, and trends low during the weekdays.\n","\n","\n","Next Steps\n","To ensure a positive result from BellaBeat's marketing strategy, I recommend:\n","\n","- **Sending reminders to encourage movement throughout the day.** It is easy to get caught up in work and routines. A quick reminder for standing or moving around can remind users of their goals without them having to become overwhealmed with remembering it all themselves. \n","- **Set up a reward system with goals and milestones** for health acheivements such as daily step goals and obtaining enough sleep. This will help visualize goals for users, motivating them by creating a clear end goal, as well as rewarding them for achieving these goals."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":7.97281,"end_time":"2023-11-12T02:47:07.841173","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-11-12T02:46:59.868363","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}